<script>
    import { onMount } from 'svelte';
    import { browser } from '$app/environment';
    import { goto } from '$app/navigation';
    import { get } from 'svelte/store';
	import { page } from '$app/stores';

    import { uri, userId, roleId, sessionId, privileges, user, totalAmount, prev_path, storeId, sw_name } from '$lib/uri.js';

    export let pathname = "";
    let full_name = "Loading...";
    let role_name = "Loading...";
    let privilegess ;

    
    $: pathnameIs = $page.url.pathname;

    $: if ($prev_path === 'assign_products_to_store' && pathnameIs.startsWith('/assign_products_to_store')) {
        storeId.set('');  
        sw_name.set('');  
    }

    $: {
        full_name = $user.user_fullname;
        role_name = $user.roles_name;
        privilegess = $privileges;
    }

    async function fetchUser() {
        const response = await fetch(`http://${$uri}:8888/user/${$userId}/${$roleId}`, {
            method: 'GET',
            headers: {
                'Content-Type': 'application/json'
            }
        });

        if (!response.ok) {
            console.error('Roles fetch failed', response);
            return;
        }

        const data = await response.json();
        // console.log("data", data);

        if (data.status !== 200) {
            console.error('Invalid user roles', data);
            return;
        }
        user.set(data.data);
    }

    async function fetchPrivileges() {
        const response = await fetch(`http://${$uri}:8888/user/privileges/${$userId}/${$roleId}`, {
            method: 'GET',
            headers: {
                'Content-Type': 'application/json'
            }
        });

        if (!response.ok) {
            console.error('Privileges fetch failed', response);
            return;
        }

        const data = await response.json();
        privileges.set(data.data);
    }
 
   onMount(async () => {
        fetchPrivileges();
        fetchUser();
   });

   function handleLogout() {
        userId.set('');
        user.set('');
        roleId.set('');
        privileges.set('');
        sessionId.set('');
        totalAmount.set('');

        goto('/login');

    }
</script>

